import { SignIn } from '@clerk/clerk-react';
import React from 'react';
import './SignIn.css';

const SignInPage = () => {
  return (
    <div className="sign-in-container">
      <SignIn 
        routing="path" 
        path="/sign-in" 
        signUpUrl="/sign-up"
        redirectUrl="/"
      />
    </div>
  );
};

export default SignInPage;
